  [],\n\t\"revision_timestamp\": \"2015-05-06T22:06:27.216822\",\n\t\"name\": \"agent-based-health-monitoring-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"We propose combination of software intelligent
  agents to achieve decentralized reasoning, with fault detection and diagnosis using
  PCA, neural nets, and maximum entropy methods.  The goal of the work is to achieve
  integrated system health management and self-reliant systems, including integration
  with the maintenance and logistics scheduling systems to achieve fully automated
  end-to-end solutions. At low levels the agents will evaluate raw sensor signals
  to detect and diagnose the cause of anomalies.  At the next higher level, the agents
  will combine the diagnostic results from multiple lower level agents to detect and
  diagnose anomalies in the interaction between components or subsystems.  If there
  is a maintenance action or a spare part indicated by the prognosis, a Task Agent
  and/or a Spare Parts agent will be spawned to interact with the appropriate agent-based
  Scheduling System to insure that the requirements are met.  Agents at each level
  are also responsible for performing graceful degradation in the event of a failure
  at their level.  At the low level, we have demonstrated that the PCA algorithm can
  greatly reduce the amount of diagnostic data that must be shared between hierarchical
  levels.  We have also demonstrated other algorithms for anomaly detection, diagnosis,
  and diagnostic data-fusion.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
